const canvas = document.getElementById('canvas');
const ctx = canvas.getContext('2d');
canvas.width = 692;
canvas.height = 866;

const image = new Image();
image.src =
  'data:image/png;base64,';

image.addEventListener('load', () => {
  ctx.drawImage(image, 0, 0);
  const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
  const { data: imageData } = pixels;
  ctx.clearRect(0, 0, canvas.width, canvas.height);

  // scannedImage.data = imageData;
  // ctx.putImageData(scannedImage, 0, 0);

  const particles = [];
  const noOfParticles = 10000;
  const imageMap = [];

  const getRelativeBrightness = (r, g, b) => {
    return Math.sqrt(r * r * 0.299 + g * g * 0.587 + b * b * 0.114) / 100;
  };

  for (let i = 0; i < canvas.height; i++) {
    const row = [];
    for (let j = 0; j < canvas.width; j++) {
      const red = imageData[i * 4 * pixels.width + j * 4];
      const green = imageData[i * 4 * pixels.width + (j * 4 + 1)];
      const blue = imageData[i * 4 * pixels.width + (j * 4 + 2)];
      const brightness = getRelativeBrightness(red, green, blue);
      //prettier-ignore
      const cell = [cellBrightness = brightness];

      row.push(cell);
    }
    imageMap.push(row);
  }

  class Particle {
    constructor() {
      this.x = Math.random() * canvas.width;
      this.y = 0;
      this.speed = 0;
      this.velocity = Math.random() * 0.5;
      this.size = Math.random() * 0.5 + 1;
      this.position1 = Math.floor(this.y);
      this.position2 = Math.floor(this.x);
    }
    update() {
      this.position1 = Math.floor(this.y);
      this.position2 = Math.floor(this.x);
      this.speed = imageMap[this.position1][this.position2][0];
      let movement = 2.5 - this.speed + this.velocity;

      this.y += movement;
      if (this.y >= canvas.height) {
        this.y = 0;
        this.x = Math.random() * canvas.width;
      }
    }

    draw() {
      ctx.beginPath();
      ctx.fillStyle = 'white';
      ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
      ctx.fill();
    }
  }

  const init = () => {
    for (let i = 0; i < noOfParticles; i++) {
      //prettier-ignore
      particles.push(new Particle());
    }
  };
  init();

  const animate = () => {
    ctx.globalAlpha = 0.05;
    ctx.fillStyle = 'rgb(0, 0, 0)';
    ctx.fillRect(0, 0, canvas.width, canvas.height);
    ctx.globalAlpha = 0.2;
    for (let i = 0; i < particles.length; i++) {
      particles[i].update();
      ctx.globalAlpha = particles[i].speed * 0.2;
      particles[i].draw();
    }
    requestAnimationFrame(animate);
  };
  animate();
});
